<p>
<p>–°–ø–æ—á–∞—Ç–∫—É –±—É–ª–∏ –æ—Ä–≥–∞–Ω—ñ–∑–æ–≤–∞–Ω—ñ –ø–µ—Ä—à—ñ –¢–°–û–ó–∏, –∞ –Ω–∞ —ó—Ö –æ—Å–Ω–æ–≤—ñ –±—É–ª–∏ —Å—Ç–≤–æ—Ä–µ–Ω—ñ –∫–æ–ª–≥–æ—Å–ø–∏. –í —Ä–æ—Ü—ñ –±—É–ª–æ –∑–∞–∫–ª–∞–¥–µ–Ω–æ –≤–µ–ª–∏–∫—É –Ω–∞ —Ç–æ–π —á–∞—Å —à–∞—Ö—Ç—É ¬´–ö—Ä–µ–º—ñ–Ω–Ω–∞-–°—Ö—ñ–¥–Ω–∞¬ª, —Ä–æ–∑—Ä–∞—Ö–æ–≤–∞–Ω—É –Ω–∞ –≤–∏–¥–æ–±—É—Ç–æ–∫ ‚Äî —Ç–æ–Ω–Ω –≤—É–≥—ñ–ª–ª—è –Ω–∞ –¥–æ–±—É. –®–∞—Ö—Ç–∞ —Å—Ç–∞–ª–∞ –¥–æ –ª–∞–¥—É —É —Ä–æ—Ü—ñ.</p><strong><a id='l1'></a><h2>–ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –ö—Ä–µ–º—ñ–Ω–Ω–∞</h2></strong><p>–í —Ä–æ—Ü—ñ –≤ –ö—Ä–µ–º—ñ–Ω–Ω—ñ–π –≤—ñ–¥–∫—Ä–∏—Ç–æ –º–∞–π—Å—Ç–µ—Ä–Ω—é –∑ —Ä–µ–º–æ–Ω—Ç—É –±–∞—è–Ω—ñ–≤, –Ω–∞ –æ—Å–Ω–æ–≤—ñ —è–∫–æ—ó –∑–≥–æ–¥–æ–º –≤–∏—Ä–æ—Å–ª–∞ –≤—ñ–¥–æ–º–∞ –Ω–∞ –≤—Å—é –£–∫—Ä–∞—ó–Ω—É —Ñ–∞–±—Ä–∏–∫–∞ –±–∞—è–Ω—ñ–≤. –£ —Ä–æ—Ü—ñ —Å—Ç–≤–æ—Ä–µ–Ω–æ –ø—Ä–æ–º–∏—Å–ª–æ–≤—É –∞—Ä—Ç—ñ–ª—å, —â–æ –≤–∏–ø—É—Å–∫–∞–ª–∞ –±—Ä–∏—á–∫–∏ —ñ —Ä—ñ–∑–Ω–∏–π —Å—ñ–ª—å–≥–æ—Å–ø—ñ–Ω–≤–µ–Ω—Ç–∞—Ä, —è–∫—É –Ω–∞—Å—Ç—É–ø–Ω–æ–≥–æ —Ä–æ–∫—É –±—É–ª–æ —Ä–µ–æ—Ä–≥–∞–Ω—ñ–∑–æ–≤–∞–Ω–æ –Ω–∞ –º–µ–±–ª–µ–≤—É —Ñ–∞–±—Ä–∏–∫—É, –¥–µ –≤–∏–≥–æ—Ç–æ–≤–ª—è–ª–∏—Å—è —à–∫—ñ–ª—å–Ω—ñ, –º–µ–±–ª—ñ. –£ –ö—Ä–µ–º—ñ–Ω—Å—å–∫–∏—Ö –ª—ñ—Å–∞—Ö –ø–æ—á–∞–≤ –¥—ñ—è—Ç–∏ –ø–∞—Ä—Ç–∏–∑–∞–Ω—Å—å–∫–∏–π –∑–∞–≥—ñ–Ω –ø—ñ–¥ –∫–æ–º–∞–Ω–¥—É–≤–∞–Ω–Ω—è–º –Ø. –í —Å–µ—Ä–µ–¥–∏–Ω—ñ —Å—ñ—á–Ω—è —Ä–æ–∫—É –Ω–∞ –ø—ñ–¥—Å—Ç—É–ø–∞—Ö –¥–æ –ö—Ä–µ–º—ñ–Ω–Ω–æ—ó —Ä–æ–∑–≥–æ—Ä—ñ–ª–∏—Å—è –∂–æ—Ä—Å—Ç–æ–∫—ñ –±–æ—ó. –ó –ö—Ä–µ–º—ñ–Ω—Å—å–∫–æ–≥–æ —Ä–∞–π–æ–Ω—É –∑–∞ –ø–µ—Ä—ñ–æ–¥ –ù—ñ–º–µ—Ü—å–∫–æ-—Ä–∞–¥—è–Ω—Å—å–∫–æ—ó –≤—ñ–π–Ω–∏ –Ω–∞ —Ñ—Ä–æ–Ω—Ç –ø—ñ—à–ª–æ –º–∞–π–∂–µ —á–æ–ª–æ–≤—ñ–∫, –∑ –Ω–∏—Ö –∑–∞–≥–∏–Ω—É–ª–æ –Ω–∞ –¥–æ—Ä–æ–≥–∞—Ö –≤—ñ–π–Ω–∏.</p>
<p>–û—Å–æ–±–ª–∏–≤–æ —ñ–Ω—Ç–µ–Ω—Å–∏–≤–Ω–æ –ø–æ—á–∞–ª–æ —Ä–æ–∑–≤–∏–≤–∞—Ç–∏—Å—è –≥–æ—Å–ø–æ–¥–∞—Ä—Å—Ç–≤–æ –ö—Ä–µ–º—ñ–Ω—â–∏–Ω–∏ –ø—ñ—Å–ª—è –∑–∞–∫—ñ–Ω—á–µ–Ω–Ω—è –≤—ñ–π–Ω–∏. –£ —Ä–æ—Ü—ñ –∫—Ä–µ–º—ñ–Ω—Å—å–∫–∏–π –±–∞—è–Ω –∑–∞–π–Ω—è–≤ –¥—Ä—É–≥–µ –º—ñ—Å—Ü–µ –Ω–∞ –†–µ—Å–ø—É–±–ª—ñ–∫–∞–Ω—Å—å–∫–æ–º—É –∫–æ–Ω–∫—É—Ä—Å—ñ –º—É–∑–∏—á–Ω–∏—Ö —ñ–Ω—Å—Ç—Ä—É–º–µ–Ω—Ç—ñ–≤.</p><a id='l2'></a><h3>–í—ñ–¥–µ–æ—Ñ–∞–π–ª–∏</h3><p>–ú–µ—Ö–∞–Ω—ñ–∑–∞—Ç–æ—Ä–∏ —Å. –ù–æ–≤–æ—ó –ê—Å—Ç—Ä–∞—Ö–∞–Ω—ñ —É —Ä–æ—Ü—ñ –≤–∏—Ä–æ—Å—Ç–∏–ª–∏ –π –∑—ñ–±—Ä–∞–ª–∏ –Ω–∞ –ø–ª–æ—â—ñ –≥–∞ –ø–æ 22,9 —Ü –æ–∑–∏–º–æ—ó –ø—à–µ–Ω–∏—Ü—ñ –∑ –≥–µ–∫—Ç–∞—Ä–∞. –ë—Ä–∏–≥–∞–¥–∏—Ä—É –º–µ—Ö–∑–∞–≥–æ–Ω—É –°. –ë–æ—á–∞—Ä–Ω–∏–∫–∞ –±—É–ª–æ –ø—Ä–∏—Å–≤–æ—î–Ω–æ –∑–≤–∞–Ω–Ω—è –ì–µ—Ä–æ—è –°–æ—Ü—ñ–∞–ª—ñ—Å—Ç–∏—á–Ω–æ—ó –ü—Ä–∞—Ü—ñ. –ó–∞ –ø–µ—Ä—ñ–æ–¥ –∑ –ø–æ —Ä—ñ–∫ –±—É–ª–æ –ø–æ—Å–∞–¥–∂–µ–Ω–æ –≥–∞ –ª—ñ—Å—É —ñ –ø–ª–æ—â–∞ –∫—Ä–µ–º—ñ–Ω—Å—å–∫–æ–≥–æ –ª—ñ—Å–æ–≤–æ–≥–æ –º–∞—Å–∏–≤—É –¥–æ—Å—è–≥–ª–∞ 40 —Ç–∏—Å. –£ –∫—Ä–µ–º—ñ–Ω—Å—å–∫–æ–º—É –∑–≤—ñ—Ä–æ–≥–æ—Å–ø–æ–¥–∞—Ä—Å—Ç–≤—ñ —Ä–æ–∑–≤–æ–¥–∏–ª–∏ —Å—Ä—ñ–±–ª—è—Å—Ç–æ-—á–æ—Ä–Ω–∏—Ö –ª–∏—Å–∏—Ü—å —Ç–∞ –Ω–æ—Ä–æ–∫.</p>
<p>–£ —Ä–æ—Ü—ñ –∑–≤—ñ—Ä–æ—Ñ–µ—Ä–º–∞ –º–∞–ª–∞ –≤–∂–µ –ª–∏—Å–∏—Ü—ñ –π –Ω–æ—Ä–æ–∫. –í —Ä–æ—Ü—ñ –∂–∏—Ç–ª–æ–≤–∏–π —Ñ–æ–Ω–¥ –º—ñ—Å—Ç–∞ —Å—Ç–∞–Ω–æ–≤–∏–≤ ,6 —Ç–∏—Å. –ú—ñ—Å—Ç–æ –±—É–ª–æ –ø–æ–≤–Ω—ñ—Å—Ç—é –ø—ñ–¥–∫–ª—é—á–µ–Ω–µ –¥–æ —Å–∏—Å—Ç–µ–º–∏ ¬´–î–æ–Ω–±–∞—Å–µ–Ω–µ—Ä–≥–æ¬ª. –í –º—ñ—Å—Ç—ñ –∑–±—É–¥–æ–≤–∞–Ω–æ –æ–¥–Ω–µ –∑ –Ω–∞–π–∫—Ä–∞—â–∏—Ö –≤ —Ä–µ—Å–ø—É–±–ª—ñ—Ü—ñ –ª—ñ–∫–∞—Ä–Ω—è–Ω–µ –º—ñ—Å—Ç–µ—á–∫–æ. –£ –Ω—å–æ–≥–æ –≤—Ö–æ–¥–∏–≤ —Å—Ç–∞—Ü—ñ–æ–Ω–∞—Ä –Ω–∞ –ª—ñ–∂–æ–∫ —ñ –ø–æ–ª—ñ–∫–ª—ñ–Ω—ñ–∫–∞, –æ—Å–Ω–∞—â–µ–Ω—ñ –Ω–æ–≤—ñ—Ç–Ω—å–æ—é –º–µ–¥–∏—á–Ω–æ—é –∞–ø–∞—Ä–∞—Ç—É—Ä–æ—é. –£ —Ä–æ—Ü—ñ –≤ –ö—Ä–µ–º—ñ–Ω–Ω—ñ–π –≤—ñ–¥–∫—Ä–∏—Ç–æ –º–µ–¥–∏—á–Ω–µ —É—á–∏–ª–∏—â–µ, —è–∫–µ –≥–æ—Ç—É–≤–∞–ª–æ –º–µ–¥–∏—á–Ω–∏—Ö —Å–µ—Å—Ç–µ—Ä —ñ —Ñ–µ–ª—å–¥—à–µ—Ä—ñ–≤ –¥–ª—è –ª—ñ–∫—É–≤–∞–ª—å–Ω–∏—Ö —ñ –ø—Ä–æ—Ñ—ñ–ª–∞–∫—Ç–∏—á–Ω–∏—Ö —É—Å—Ç–∞–Ω–æ–≤ –æ–±–ª–∞—Å—Ç—ñ.</p><strong><a id='l3'></a><h2>–ö—Ä–µ–º—ñ–Ω–Ω–∞ —Å–∞–π—Ç –º—ñ—Å—Ç–∞ üè† | –õ—É–≥–∞–Ω—Å—å–∫–∞ –æ–±–ª–∞—Å—Ç—å | –£–∫—Ä–∞—ó–Ω–∞ ‚Äî mistaUA</h2></strong><p>–ê–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–æ-—Ç–µ—Ä–∏—Ç–æ—Ä—ñ–∞–ª—å–Ω–æ —Ä–∞–π–æ–Ω –ø–æ–¥—ñ–ª—è—î—Ç—å—Å—è –Ω–∞ 1 –º—ñ—Å—å–∫—É —Ä–∞–¥—É , 1 —Å–µ–ª–∏—â–Ω—É —Ä–∞–¥—É —Ç–∞ 16 —Å—ñ–ª—å—Å—å–∫–∏—Ö —Ä–∞–¥ , —è–∫—ñ –æ–±'—î–¥–Ω—É—é—Ç—å 38 –Ω–∞—Å–µ–ª–µ–Ω–∏—Ö –ø—É–Ω–∫—Ç—ñ–≤ —ñ –ø—ñ–¥–ø–æ—Ä—è–¥–∫–æ–≤–∞–Ω—ñ –ö—Ä–µ–º—ñ–Ω—Å—å–∫—ñ–π —Ä–∞–π–æ–Ω–Ω—ñ–π —Ä–∞–¥—ñ. –ê–¥–º—ñ–Ω—ñ—Å—Ç—Ä–∞—Ç–∏–≤–Ω–∏–π —Ü–µ–Ω—Ç—Ä¬†‚Äî –º—ñ—Å—Ç–æ —Ä–∞–π–æ–Ω–Ω–æ–≥–æ –∑–Ω–∞—á–µ–Ω–Ω—è –ö—Ä–µ–º—ñ–Ω–Ω–∞ [7]. –û–±—Å—è–≥ —Ä–µ–∞–ª—ñ–∑–æ–≤–∞–Ω–æ—ó –ø—Ä–æ–º–∏—Å–ª–æ–≤–æ—ó –ø—Ä–æ–¥—É–∫—Ü—ñ—ó –Ω–∞ –æ–¥–Ω—É –æ—Å–æ–±—É¬†‚Äî  –§—ñ–Ω–∞–Ω—Å–æ–≤–∏–π —Ä–µ–∑—É–ª—å—Ç–∞—Ç –≤—ñ–¥ –∑–≤–∏—á–∞–π–Ω–æ—ó –¥—ñ—è–ª—å–Ω–æ—Å—Ç—ñ –¥–æ –æ–ø–æ–¥–∞—Ç–∫—É–≤–∞–Ω–Ω—è —Å—Ç–∞–Ω–æ–º –Ω–∞  –Ü–Ω–æ–∑–µ–º–Ω—ñ —ñ–Ω–≤–µ—Å—Ç–∏—Ü—ñ—ó. –û–±—Å—è–≥–∏ –Ω–∞ –æ–¥–Ω—É –æ—Å–æ–±—É, –¥–æ–ª.</p>
